import s from "./style.module.css";

const PlayerBoard = (cards) => {
  return (
    <>
      {cards.map(({ values, name, img, id, type }) => {
        return (
          <div className={s.cardBoard}>
            <PokemonCard
              key={id}
              values={values}
              name={name}
              img={img}
              id={id}
              type={type}
              minimize
              isActive={true}
            />
          </div>
        );
      })}
    </>
  );
};

export default PlayerBoard;
